import React from 'react';
import Main from './components/Main'
import Post from './components/Post'



const Home = () => {
  return (
    <>
 <Main>
       <h1>Mite News</h1>

            <Post id="2" date='2022-03-02' text="
          i am currently shamelessly using my Official Artist  Website as a React.js practice space (first of my own projects). my goals are to make a basic ">

          </Post>


          <Post id="1" date='2022-03-01' text="
          good news for Mite fans! today, the website was launched. well, it was launched for Mite's private use only. but you'll be able to find out everything you need to know about Mite here. just wait a little longer">

          </Post>


         </Main>



    </>
  );
};

export default Home;
